"use strict";$(".collapseItem").click(function(){var e=$(this).next();$(e).slideToggle()}),$(".del-category").click(function(e){var t=$(e.target).data("id"),c=$(".item-id-"+t);$.ajax({type:"DELETE",url:"/admin/category/list?id="+t,success:function(e){1===e.success&&c.length>0&&c.remove()}})}),$(".del-article").click(function(e){var t=$(e.target).data("id"),c=$(".item-id-"+t);$.ajax({type:"DELETE",url:"/admin/article/list?id="+t,success:function(e){1===e.success&&c.length>0&&c.remove()}})});